import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Outline from './outline.png';
import Typed from 'react-typed';


function Home() {

    return(
        <React.Fragment>
            <Container>
                <Row>
                    <Col>
                        <h1>Hello!</h1>
                        <h2>My name is Rohan Bawa. I am a </h2>
                             <span id="typed"></span>

                             <ReactTyped
                                 typedRef={typedRef()}
                                 loop
                                 typeSpeed={50}
                                 backSpeed={20}
                                 strings={["welcome to react-typed", "This is a react component that wraps up the <a hre…", "If you like the project add a star in <a href="]}
                            />
                    </Col>
                    <Col>
                        <img src={Outline} alt='outline'/>
                    </Col>
                </Row>
            </Container>
        </React.Fragment>
    );

}

export default Home;
